import ComponentePrueba from './componente-prueba'
import FormularioPrueba from './formulario-prueba'

class ContenedorPrueba extends React.Component {
    render () {
        return ( 
        <div>
            <ComponentePrueba/>
            <FormularioPrueba/>
        </div>
            )
    }
}

export default ContenedorPrueba
